  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0084176 includes chemical,
  physical, and underway - surface data collected aboard NOAA Ship DAVID STARR JORDAN
  in Channel Islands National Marine Sanctuary, Cordell Bank National Marine Sanctuary,
  Gulf of California, Gulf of the Farallones National Marine Sanctuary, Monterey Bay
  National Marine Sanctuary, and North Pacific Ocean from 20060806 to 20071028 and
  retrieved during cruise DS0704, DS0705, DS0706_1, DS0706_2, DS0706_3, and DS0706_4.
  These data include CARBON DIOXIDE - MOLE FRACTION - AIR, CARBON DIOXIDE - PARTIAL
  PRESSURE - DIFFERENCE, CARBON DIOXIDE - PARTIAL PRESSURE - SEA, SALINITY, and SEA
  SURFACE TEMPERATURE. The instruments used to collect these data include Carbon dioxide
  (CO2) gas analyzer, Carbon dioxide (CO2) shower head chamber equilibrator, and thermosalinographs.
  These data were collected by Richard A Feely of Pacific Marine Environmental Laboratory.\",\n\t\"owner_org\":
